webpackJsonp([0xb47964dbf221],{752:function(e,t){e.exports={data:{markdownRemark:{html:'<p>This presentation provides a high level overview of how to begin testing your web applications\nwith <a href="https://github.com/teamcapybara/capybara">Capybara</a> which provides a Domain Specific Language for writing browser level feature tests for your web application, and <a href="http://rspec.info/">RSpec</a> the Ruby test runner.</p>\n<p>It discusses testing from the outside in, as well as the benefits of testing, and test driven development.\nImportantly this presentation also provides detail on common race-conditions and issues associated with\nfeature driven development, and suggests methods to deal with these scenarios.</p>',frontmatter:{title:"Capybara Feature Testing",date:"01 December, 2015"},fields:{slug:"/talks/2015-12-01-capybara-feature-testing-presentation/"}}},pathContext:{slug:"/talks/2015-12-01-capybara-feature-testing-presentation/"}}}});
